function List(props) {
  return (
    <div>
      <h1></h1>
      {props.ContentList.map((content, idx) => {
        return (
          <div
            key={idx}
            style={{
              width: "100%",
              marginLeft: "1rem",
            }}
          >
            내용: {content}
            <hr />
          </div>
        );
      })}
    </div>
  );
}
